-- ----------------------------
-- Records of techer
-- ----------------------------
BEGIN;
INSERT INTO `techer` VALUES (22, '周杰伦', '1', NULL, 1, 'Y', 5.0, 8, 4, 2015, '10,11,12,13,', '14,15,', '哎哟，不错哦', '16,17,18,19,20,21,', '13838384389', 'Y', '第一张专辑《Jay》获得台湾金曲奖最佳专辑、并一举夺得台湾当年最佳流行音乐演唱专辑、最佳制作人和最佳作曲人三项大奖。同年，并获得新加坡金曲奖最佳新人奖。[83]\n第二张专辑《范特西》获得包括最佳专辑、最佳编曲等在内的五个金曲奖奖项。[84]\n随后连续三年金曲奖角逐的失败使周杰伦心灰意冷，但却又以《青花瓷》和《稻香》二曲分别拿下两届金曲奖年度最佳歌曲奖\n周杰伦于第20届和第22届金曲奖以《魔杰座》和《跨时代》两张专辑拿下最佳国语男歌手等奖项。[85][86]\n周杰伦于2002年至2006年曾连续5年获得香港IFPI最佳销量国语唱片奖[87][88][89][90][91]。\n周杰伦获得香港叱咤乐坛流行榜颁奖典礼我最喜爱的歌曲大奖的台湾歌手\n周杰伦于2001年以《开不了口》得奖，同时他亦是继周华健后第二位获得叱咤乐坛唱作人大奖的台湾歌手。\n周杰伦出道7年，在十大中文金曲中只有2005年没得到全国最受欢迎中文歌曲奖项。[可疑 –讨论]\n周杰伦出道以来，发行的其中四张专辑（分别为《Jay》、《范特西》、《叶惠美》和《跨时代》）曾拿下金曲奖最佳国语专辑奖。\n周杰伦分别于2004年、2006年、2007年、2008年，共四次获得世界音乐大奖“亚洲最高销量艺人”奖。[92]', '周杰伦他自小对音乐表现出浓厚的兴趣，而且喜欢模仿歌星、演员表演和变魔术。3岁开始学习钢琴。周杰伦国小时住在台北市光华商场附近，就读忠孝国小。国中时就读金华国中，此时期他的父母因长年争执而决议离婚，使周杰伦的性情大受影响。除了音乐外，周杰伦热爱篮球，他在国中参加篮球队，结识学长陈建州。在同侪中是高手，球场上的表现常受众人围观。\n\n高中就读于台北县私立淡江中学第一届音乐科（本来是想报考华冈艺校，但错过了报名期间，幸好淡江中学恰巧新设了音乐科），主修钢琴，副修大提琴，为将来的音乐发展打下了深厚的基础[7]。这时的他因正值青春期，常常秀琴技想吸引女同学的注意。但学科成绩不甚理想，故高中毕业时，大学联考落榜；又因患有僵直性脊椎炎，依据台湾兵役制度得以免服义务兵役。[8]。\n\n周杰伦曾说过表示少年时受到香港乐坛“四大天王”之一张学友的专辑《吻别》的影响，从而喜欢并开始专注于流行音乐[9]。另外他也透漏过，除了张学友以外，李恕权与史帝夫·汪达也是他童年时影响他很深的人，李恕权每回出现在电视上，周杰伦便会在电视机面前模仿他，而史帝夫·汪达有一首《I just called to say I love you》是他的婶婶曾在他叔父的葬礼中播放的歌曲。由于他的音乐基础扎实，令其在流行音乐创作方面如鱼得水。', '2018-04-02 19:45:31', '2018-04-02 22:09:40');
COMMIT;

